import React, { Component } from 'react'
import './Map.css';
import Marker from '../Markers/Marker'
import { ReactComponent as Mapimg } from './6thFloorMap15.svg'

export default class extends Component{
    constructor(props){
        super(props);
        this.state={
            marks:''
        }
    }

    render(){

        return(
            <div class="image">
                <Mapimg />
            </div>
        )
    }
}
